using namespace std;

Game::Game() {
    this->initSeq();
    this->initDisplay();
}

// Function to get bop-it sequence turn numbers
void Game::initSeq() {
    // Need to include:
    //      srand(time(0))
    // in the main code (driver code)

    int upper = 3; // Number of different functions
    int lower = 1;
    
    // Generate random turn sequence
    for (int i = 0; i < this->getTotTurns(); i++) {
        int n = (rand() % (upper - lower + 1)) + lower;
        this->setTurn(i, n);
    }
}

// Function to set display values
void Game::initDisplay() {
    lcd.setCursor(0, 0);         // move cursor to   (0, 0)
    lcd.print("Welcome to");     // print message at (0, 0)
    lcd.setCursor(5, 1);         // move cursor to   (5, 1)
    lcd.print("BOP-IT PRO!");    // print message at (5, 1)
}

void Game::startGame() {
    // Print begin message

    // Begin first turn
    this->takeTurn();
}

void Game::takeTurn() {
    // Display turn action message
    int action = this->getTurn(turnCount);
    string message = this->getDisplayText(action);

    // Increment turn count
    turnCount++;
}

